// src/Components/Admin/Settings.js
import React, { useState } from "react";
import { supabase } from "../../Supabase/supabaseClient";
import "../../Style/Admin.css";

function Settings() {
  const [password, setPassword] = useState("");
  const [theme, setTheme] = useState("light");
  const [notifications, setNotifications] = useState(true);
  const [maintenanceMode, setMaintenanceMode] = useState(false);
  const [message, setMessage] = useState("");

  // Update password
  const handlePasswordUpdate = async () => {
    if (!password) {
      setMessage("❌ Please enter a new password.");
      return;
    }
    const { error } = await supabase.auth.updateUser({ password });
    if (error) {
      setMessage("❌ Error: " + error.message);
    } else {
      setMessage("✅ Password updated successfully!");
      setPassword("");
    }
  };

  // Simulated save settings
  const handleSaveSettings = () => {
    setMessage("✅ Settings saved successfully!");
  };

  return (
    <div className="page-container">
      <h2>⚙️ Admin Settings</h2>

      {/* Security */}
      <div className="card">
        <h3>🔑 Security</h3>
        <div className="form-group">
          <label>New Password</label>
          <input
            type="password"
            placeholder="Enter new password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <button className="btn danger" onClick={handlePasswordUpdate}>
          Update Password
        </button>
      </div>

      {/* Preferences */}
      <div className="card">
        <h3>🎨 Preferences</h3>
        <div className="form-group">
          <label>Theme</label>
          <select value={theme} onChange={(e) => setTheme(e.target.value)}>
            <option value="light">🌞 Light</option>
            <option value="dark">🌙 Dark</option>
          </select>
        </div>
        <div className="form-group checkbox">
          <input
            type="checkbox"
            checked={notifications}
            onChange={() => setNotifications(!notifications)}
          />
          <label>Enable Email Notifications</label>
        </div>
      </div>

      {/* System Controls */}
      <div className="card">
        <h3>🛠 System Controls</h3>
        <div className="form-group checkbox">
          <input
            type="checkbox"
            checked={maintenanceMode}
            onChange={() => setMaintenanceMode(!maintenanceMode)}
          />
          <label>Enable Maintenance Mode</label>
        </div>
        <button className="btn primary" onClick={handleSaveSettings}>
          Save Settings
        </button>
      </div>

      {/* Danger Zone */}
      <div className="card danger-zone">
        <h3>⚠️ Danger Zone</h3>
        <p>These actions are irreversible. Proceed with caution.</p>
        <button className="btn danger">Delete All Logs</button>
        <button className="btn danger">Reset Database</button>
      </div>

      {message && <p className="message">{message}</p>}
    </div>
  );
}

export default Settings;
